var notificationtray_pc_assistant_statement  = "<p>1. اعطای مجوز<br/>به‌جز در مواردی که صریحاً در این توافق‌نامه مجوز کاربر نهایی آمده است، تنها اجازه نصب و استفاده از یک نسخه از محصول نرم‌افزاری را بر روی یک سیستم رایانه‌ای دارید.<br/>می‌توانید یک کپی پشتیبان از بخش نرم‌افزار رایانه‌ای محصول نرم‌افزاری و فقط به منظور آرشیو تهیه کنید.</p><p>2. محدودیت مجوز<br/>استفاده از محصول نرم‌افزاری بر روی چندین رایانه از طریق به اشتراک‌گذاری تمام یا بخشی از محصول نرم‌افزاری.<br/>حذف اعلامیه‌های کپی‌رایت هر یک از نسخه‌های محصول نرم‌افزاری.<br/>افشا، انتقال، ارائه، اجاره یا در دسترس قرار دادن نرم‌افزار یا هر بخشی از آن به هر شکل دیگر جهت اشخاص ثالث بدون موافقت قبلی Huawei.</p><p>3. برنامه متعلق به Huawei خواهد بود<br />کلیه حقوقی که به‌طور مشخص در این توافق‌نامه مجوز کاربر نهایی اعطاء نشده برای Huawei محفوظ است.</p>";
